import React from "react";

function Skills(props) {
  return (
    <div>
      <h3>Skills</h3>
      <ul>
        <li>{props.skillA}</li>
        <li>WordPress</li>
        <li>ReactJs</li>
      </ul>
    </div>
  );
}

export default Skills;
